import React from 'react';

const BookContainer = (props) => {
    // a            author: "",
    //  a           book_image: "",
    //  a           description: "",
    //  a           grRating: "",
    // a            numPages: "",
    //   x          primary_isbn10: "",
    //             reviews: "",
    //  a           title: "",
    //             url: ""
    return (
        <div>
            <img src={props.book.title}/>
            <div>title: {props.book.title}</div>
            <div>Author: {props.book.title}</div>
            <div>Pages: {props.book.title}</div>
            <div>Description: {props.book.title}</div>
            <div>Rating: {props.book.title}</div>
            <div>goodreads Url: {props.book.title}</div>
            <div>Reviews: {props.book.title}</div>
        </div>
    );
};

export default BookContainer;
